  return (
    <div className="gpt3__navbar">
    <div className="gpt3__navbar-links">
    <div className="gpt3__navbar-links_logo"></div>
    <img src={logo} alt="logo"/>

    </div>
    
    </div>
  )
}

export default Navbar
